export const HomeContainer=styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    width: 100vw;
    height: 100vh;

    background-image: url('https://images.unsplash.com/photo-1604881746779-3ee284c39d6a?ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80');

    background-size: cover;
`;

export const HomeH1=style.div`
    color: #eee;
    font-size: 60px;
